import { Avatar } from '@material-ui/core';
import React from 'react';
import './Post.css';

function Post({profilePic, image, username,timestamp}) {
    return (
        <div className="post">
            <div className="post_top">
                <Avatar />
            </div>
            
        </div>
    );
};

export default Post;
